import styled from 'styled-components';

const LogoutContainer = styled.button`
    display: flex;
    justify-content: center;
    align-items: center;
    padding 0.5rem;
    background-color: rgb(250,200,150);
    border: none;
    border-radius: 5px;
    svg {
        font-size: 1.3rem;
        color: #ebe7ff;
    }
`;

export default LogoutContainer;
